import Home from "./components/Home";
import { BrowserRouter as Router,Route, Routes} from 'react-router-dom';

import './App.css';
import Navbar from "./components/Navbar";
import Works from "./components/Works";


function App() {
  return (
    <>
    <Router>
       <Navbar/>
         <Routes>
         <Route  path='/works' element={<Works/>}/>

        <Home/>


        </Routes>
      </Router>
    </>

  );
}

export default App;
